import React from 'react';


export default function Social() {
  return (
    <div className="home__social">

        <a href="https://www.instagram.com/yuri_lanzini/" className="home__social-icon" target="_blank">
            <i className="uil uil-instagram"></i>
        </a>

        <a href="https://github.com/YuriLanzini" className="home__social-icon" target="_blank">
            <i className="uil uil-github-alt"></i>
        </a>
    </div>
);
}
